import React from 'react'
import './project.css';
import screenshot from '../../assets/prjss.png'


function Project() {
  return (
    <section id='projectPage'>
    <div className="projectTitle">Project</div>
    <div className="bar">
      <img src="{screenshot}" alt="" className='ssimg' />
    </div>
    </section>
  )
}

export default Project
